import { GoogleLogin } from 'react-google-login';

const clientId = "https://955568137419-b1hsm5gmouemhhr25s1l9op6hu8b8ajj.apps.googleusercontent.com/";

const Login = () => {

    const onSuccess = (res) => {
        console.log("Login success! Current user: ", res.profileObj);
    }

    const onFailure = (res) => {
        console.log("Login failed! res: ", res);
    }

    return (
        <div id="signInButton">
            <GoogleLogin
                clientId={clientId}
                buttonText={"Login"}
                onSuccess={onSuccess}
                onFailure={onFailure}
                cookiePolicy={"single_host_origin"}
                isSignedIn={true}
            />
        </div>
    )
}

export default Login;
